import React from 'react';
import './App.css';
import ColorBlock from './components/Colorblock';

function App() {
  const colors = ['red', 'gray', 'lightblue', 'purple', 'tan', 'yellow', 'lightgray', 'lightblue'];

  let colorMap = colors.map((color, i) => {
    return (
      <ColorBlock color={color} />
    )
  })

  return (
    <div className="App">
      {colorMap}
    </div>
  )
}

export default App;
